import React from 'react';
import './wordstatuscheckbox.css';

class WordStatusCheckbox extends React.Component {
  
  lala () {
    console.log("yup it's a button");
    //if not enough words in said category -> pop-up with info
  }

  render () {
    return (
      <div class="container">
        <div class="control-group">
          <h1>Checkboxes</h1>
          <label class="control control--checkbox">First checkbox
            <input type="checkbox" checked="checked"/>
            <div class="control__indicator"></div>
          </label>
          <label class="control control--checkbox">Second checkbox
            <input type="checkbox"/>
            <div class="control__indicator"></div>
          </label>
          <label class="control control--checkbox">Disabled
            <input type="checkbox" disabled="disabled"/>
            <div class="control__indicator"></div>
          </label>
          <label class="control control--checkbox">Disabled & checked
            <input type="checkbox" disabled="disabled" checked="checked"/>
            <div class="control__indicator"></div>
          </label>
        </div>
      </div>
    );
  }
}

export default WordStatusCheckbox;
